pragma solidity ^0.4.2;

contract Rent {
    //state Variables which are going to store in block chain
    address seller;    //address of the wallet
    string name;       //array of characters
    string description;
    uint256 price;       //amount
    uint256 startdate;
    uint256 enddate;

    //Sell a Flat
    function sellFlat(string _name,string _description,uint256 _price,uint256 _startdate,uint256 _enddate)
    public {
        seller = msg.sender;
        name = _name;
        description=_description;
        price=_price;
        startdate = _startdate;
        enddate = _enddate;
    }
      //calling it is free
      //get the flat
      //declared constant
    function getFlat() public constant returns (
      address _seller,
      string _name,
      string _description,
      uint256 _price,
      uint256 _startdate,
      uint256 _enddate){
        return(seller,name,description,price,startdate,enddate);

    }

}
